def solve(n):
    result = [1]
    counter = 1
    while len(result) < n:
        temp = []
        for i in range(counter):
            for j in range(1, counter+1):
                num = i+1 + j
                if num not in temp:
                    temp.append(num)
        result.extend(temp)
        counter += 1
    return result[n-1]

def solve(n):
    i = 1
    polite_nums = []
    while len(polite_nums) < n:
        if i % 2 == 0:
            polite_nums.append(i)
        else:
            if i % 3 == 0 or i % 5 == 0:
                polite_nums.append(i)
        i += 1
    return polite_nums[-1]

