def solve(n):
    result = []
    num = 1
    while len(result) < n:
        if num % 2 != 0 and num % 3 != 0 and num % 5 != 0:
            result.append(num)
        elif num % 2 == 0 and num % 3 == 0 and num % 5 == 0:
            result.append(num)
        num += 1
    return result[-1]

def solve(n):
    count = 0
    num = 1
    while count < n:
        if num % 2 == 0:
            num = num // 2
        elif num % 3 == 0:
            num = num // 3
        elif num % 5 == 0:
            num = num // 5
        else:
            count += 1
        num += 1
    return num - 1
